import React, { useState, useEffect } from 'react';
import './DogsByBreed.css';

const DogsByBreed = () => {
  const breeds = ['shiba', 'terrier', 'retriever', 'husky', 'chihuahua', 'beagle'];
  const [dogs, setDogs] = useState([]);

  useEffect(() => {

    const onShiba = () => {
      fetch(`https://dog.ceo/api/breed/shiba/images/random/5`)
      .then(res => res.json())
      .then(result => {
        setDogs(result.message)
      })
    }
    // fetch(`https://dog.ceo/api/breed/shiba/images/random/5`)
    //   .then(res => res.json())
    //   .then(result => {
    //     setDogs(result.message)
    //   })
  }, [])

  return (
    <div>
      {/* {breeds.map(breed =>
        <button key={breed}>{breed}</button>
      )} */}
      <button onClick = {onShiba}>shiba</button>
      <button onClick = {onTerrier}>terrier</button>
      <button onClick = {onRetriever}>retriever</button>
      <button onClick = {onHusky}>husky</button>
      <button onClick = {onChihuahua}>chihuahua</button>
      <button onClick = {onBeagle}>beagle</button>
      <div className='dogs-list'>
        {dogs.length !== 0 &&
          dogs.map(url =>
            <img src={url} key={url} alt="Dog" width="300" />)
        }
      </div>
    </div>
  )
}

export default DogsByBreed;
